import React from 'react';

var options = {
  weekday: 'long',
  year: 'numeric',
  month: '2-digit',
  day: 'long',
};
const currnDate = new Date().toLocaleDateString('en', options);
function Topbar() {
  return (
    <div>
      <section id='topBar_section'>
        <div className='date'>
          <h3>{currnDate}</h3>
        </div>
      </section>
    </div>
  );
}

export default Topbar;
